description:
This week, we've been hacked, wrapped in yarn and thrown into another dimension!

Playing Hacknet might not make you as cool as Angelina Jolie in that movie, but it's an impressive first-person hacking simulator - and we've got a brand new review.

Everybody fell in love with Unravel at E3 - watch Jonny Robot's interview with EA's Martin Sahlen to find out why! (Sorry, the adorable Yarny was unavailable for comment...)

It's described as a &quot;toys-to-life&quot; experience, but we prefer to think of LEGO Dimensions as the ultimate pop culture fan-service mashup. Take a look at our interview and get ready! It's out next month.

